import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Home extends Component {
  render(){
    return (
      <main className='home'>
        <Link to='/beers'>
          <img 
            src='data:image/jpeg;base64,' 
            alt='All Beers' />
          <h2>All Beers</h2>
          <p> Lorem ipsum </p>
        </Link>
        <Link to='/random-beer'>
          <img
            src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTLB1cj-pA5gr3_k_bwLJOmbieiVqmK-rYPh2JzzlrdIhX5y-Wa'
            alt='Random Beer' />
          <h2>Random Beer</h2>
          <p> Lorem ipsum </p>
        </Link>
        <Link to='/new-beer'>
          <img
            src='data:image/jpeg;base64,'
            alt='Random Beer' />
            <h2>New Beer</h2>
            <p> Lorem ipsum </p>
        </Link >

      </main>
    )
  }
}

export default Home;